pragma solidity 0.5.7;

import "./interfaces/IFactory.sol";
import "./interfaces/ISecurity.sol";
import "./interfaces/VerifiedClient.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/upgrades/contracts/upgradeability/ProxyFactory.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/ERC20.sol";

contract SecuritiesFactory is IFactory, ProxyFactory, Initializable, Ownable{

    //events
    event securitiesAdded(address indexed security, bytes32 productCategory, address issuer, bytes32 isin, address currency, bool restricted, address issueManager, bytes32[] restrictions, bytes32 country);

    struct securities{
        address currency;
        bytes32 company;
        bytes32 isin;
        uint256 amount;
        address custodian;
        address dp;
        address token;
        bool    qualified;
    }

    address[] private issues;

    //mapping security to holder to securities struct
    mapping(address => mapping(address => securities)) private securitiesHoldings;

    //mapping security to restricted countries
    mapping(address => bytes32[]) private countries;

    //mapping security to issuer
    mapping(address => address) private holders;
    mapping(address => address) private securityTokens;

    address private securityAddress;

    address private client;

    function initialize(address _security, address _client) public initializer{
        Ownable.initialize(msg.sender);
        securityAddress = _security;
        client = _client;
    }

    function getIssues() external view returns(address[] memory){
        return issues;
    }

    function issueSecurity(address security, bytes32 productCategory, bytes32 company, bytes32 isin, address currency, address issuer, address intermediary, bytes calldata encodedRestrictions, bytes32 country, bool qualified) 
                            external {  
        require(issuer==msg.sender, "Unauthorized issuer of security.");
        (bytes32[] memory restrictions) = abi.decode(encodedRestrictions, (bytes32[]));
        if(security==address(0x0)){ //if new security             
            bytes memory _payload = abi.encodeWithSignature("initialize(bytes32,bytes32,address,address,address,address)", company, isin, address(this), issuer, client, currency);
            // Deploy proxy
            address _securityToken = deployMinimal(securityAddress, _payload);

            securitiesHoldings[_securityToken][issuer].isin= isin;
            securitiesHoldings[_securityToken][issuer].company = company;
            securitiesHoldings[_securityToken][issuer].currency= currency;
            securitiesHoldings[_securityToken][issuer].token = _securityToken;
            securitiesHoldings[_securityToken][issuer].dp = intermediary;
            securitiesHoldings[_securityToken][issuer].qualified = qualified;
        
            holders[_securityToken] = issuer;   
            securityTokens[_securityToken] = security;
            issues.push(_securityToken);
        
            emit securitiesAdded(_securityToken, productCategory, issuer, isin, currency, qualified, intermediary, restrictions, country);
        }
        else{ //if existing security
            securitiesHoldings[security][issuer].isin= isin;
            securitiesHoldings[security][issuer].company = company;
            securitiesHoldings[security][issuer].currency= currency;
            securitiesHoldings[security][issuer].token = security;
            securitiesHoldings[security][issuer].dp = intermediary;
            securitiesHoldings[security][issuer].qualified = qualified;
        
            holders[security] = issuer;   
            //securityTokens[security] = security;
            issues.push(security);
            
            emit securitiesAdded(security, productCategory, issuer, isin, currency, qualified, intermediary, restrictions, country);
        }
    }

    function getHolder(address _securityToken) external view returns(address){
        return holders[_securityToken];
    }

    function getSecurity(address _securityToken) external view returns(address){
        return securityTokens[_securityToken];
    }

    function getSecurityToken(address _securityToken, address _issuer) external view returns(address, bytes32, bytes32, address,bool){
        return (securitiesHoldings[_securityToken][_issuer].token, 
                securitiesHoldings[_securityToken][_issuer].isin,
                securitiesHoldings[_securityToken][_issuer].company,
                securitiesHoldings[_securityToken][_issuer].currency,
                securitiesHoldings[_securityToken][_issuer].qualified
                );
    }
    
    function addBalance(address security, address transferor, address transferee, uint256 amount) external {
        require(holders[security]==msg.sender, "Unauthorized access");

        if(transferor!=address(0x0)){
            securitiesHoldings[security][transferee].amount= SafeMath.add(securitiesHoldings[security][transferee].amount, amount);
            securitiesHoldings[security][transferor].amount= SafeMath.sub(securitiesHoldings[security][transferor].amount, amount);
            ISecurity(securitiesHoldings[security][holders[security]].token).transferToken(transferor, transferee, amount);
        } else {
            securitiesHoldings[security][transferee].amount= amount;
            ISecurity(securitiesHoldings[security][holders[security]].token).mintToken(transferee, amount);
        }
    }

    function checkProduct(address issue) external view returns(bool){
        if(securityTokens[issue]!=address(0x0) || holders[issue]!=address(0x0))
            return true;
        else
            return false;
    }

    function setCustodian(address _securityToken, address _issuer, address _custodian) external {
        require(msg.sender==securitiesHoldings[_securityToken][holders[_securityToken]].dp, "Incorrect custodian set up");
        (bytes32 role, ,) = VerifiedClient(client).getRole(_custodian);
        require(role=="Custodian", "Invalid custodian");
        securitiesHoldings[_securityToken][_issuer].custodian = _custodian;
    }

    function getCustodian(address _securityToken, address _issuer) external view returns(address){        
        return securitiesHoldings[_securityToken][_issuer].custodian;
    }

    function restrictCountry(address _security, bytes32[] calldata _countries) external{
        countries[_security] = _countries;
    }

    function getRestrictedCountries(address _security) external view returns(bytes32[] memory){
        return countries[_security];
    }

    function getDP(address _securityToken) external view returns(address){
        return securitiesHoldings[_securityToken][holders[_securityToken]].dp;
    }
    
}
